import React, { Component } from "react";
import axios from "axios";

export default class DataFetch extends Component {
  state = {
    vol: []
  };
  componentDidMount() {
    axios
      .get(
        "https://api.stlouisfed.org/fred/series/observations?series_id=VIXCLS&api_key=81e656f7b571223f244c306d171006c6&file_type=json&observation_start=2008-03-01&observation_end=2016-03-15"
      )
      .then(data => {
        this.setState({ vol: data });
        console.log(this.state.data);
      });
  }
  render() {
    return <div></div>;
  }
}
